window.bookSummaryJSON = "<p><i>I Kissed an Earl</i> is another installment in rapidly rising star Julie Anne Long's sensual and emotionally charged Pennyroyal Green series, centered around the longstanding feud of the wealthy Eversea and Redmond families of Pennyroyal Green, Sussex. <i>I Kissed an Earl</i> absolutely brims with romance, adventure, and, of course, intense passion, as a beautiful, willful Regency lady searching for her lost brother stows away on a sailing ship - and ends up enchanting the vessel's highborn, hard-headed Captain. </p> <p><b>Contains mature themes.</b></p>"; 
